import Trails from '../components/Trails'
import Link from 'next/link';

export default function Index(props) {
    return(
    <div>
        <h1>Hello World</h1>
        <ul>
        {props.trails.map((trail) => (
            <li key={trail.id}>
                <Link href="/p/[id]" as={`/p/${trail.id}`}>
                <Trails/>
            </Link>
            </li>
        ))}
        </ul>
    </div>
    )
}
